function getUserProfile(){fetch("https://api.github.com/users/cebucoder").then(response=>response.json()).then(data=>{data.message&&"Not Found"===data.message?showError("User not available"):fetch("https://api.github.com/users/cebucoder/starred").then(response=>response.json()).then(starredRepos=>{showUserProfile(data,starredRepos.length)}).catch(error=>{showUserProfile(data,0),console.error(error)})}).catch(error=>{showError("Error fetching profile"),console.error(error)})}function showUserProfile(profile,starredCount){document.getElementById("repo").innerHTML=`${profile.public_repos}`,document.getElementById("star").innerHTML=`${starredCount}`}function showError(message){console.log(message)}getUserProfile();